import React from "react";
import { styled } from "styled-components";

export const Title = styled.div`
  font-size: 18px;
  font-weight: 400;
  line-height: 21px;
  letter-spacing: 0em;
  text-align: center;
  color: #333333;
`;

export const SmallerTitle = styled.div`
  font-size: 14px;
  font-weight: 400;
  line-height: 16px;
  letter-spacing: 0em;
  text-align: left;
  color: #333333;
`;

export const InsertBtn = styled.button``;
